function removeSwipeInfo() {
  swipeImg.removeEventListener('click', removeSwipeInfo)
  swipeImg.parentNode.removeChild(swipeImg)
  background.parentNode.removeChild(background)
}

var swipeImg = document.createElement('img')
swipeImg.style.setProperty('z-index', '1000', 'important')
swipeImg.style.setProperty('position', 'fixed', 'important')
swipeImg.style.setProperty('width', '80%', 'important')
swipeImg.style.setProperty('top', '50%', 'important')
swipeImg.style.setProperty('left', '50%', 'important')
swipeImg.style.setProperty('transform', 'translate(-50%, -50%)', 'important')
swipeImg.style.setProperty('-webkit-transform', 'translate(-50%, -50%)', 'important')
swipeImg.addEventListener('click', removeSwipeInfo)

var background = document.createElement('div')
background.style.setProperty('z-index', '999', 'important')
background.style.setProperty('position', 'fixed', 'important')
background.style.setProperty('height', '100%', 'important')
background.style.setProperty('width', '100%', 'important')
background.style.setProperty('background-color', 'rgba(0, 0, 0, 0.7)', 'important')

swipeImg.src = 'data:image/png;base64,'
document.body.appendChild(background)
document.body.appendChild(swipeImg)
